import React from 'react';

class ConfigurationMenu extends React.Component
{


    render()
    {
        return(
            <div className="sel-menu-wrapper bknrd-red grid-row-30-70">

                <div className="sel-menu-cont top">
                    <span className="txt-30px txt-bld">step 1</span>
                </div>

                <div className="sel-menu-cont bot">
                    <span className="txt-30px txt-bld">step 2</span>
                </div>

            </div>
        )
    }


}

export default ConfigurationMenu;
